class GELULSQFakeQuantize(QuantizeBase):

    def __init__(self, observer, bit=8, symmetric=False, ch_axis=-1, use_grad_scaling=True):
        super().__init__(observer, bit=bit, symmetric=symmetric, ch_axis=ch_axis)
        self.scale = torch.nn.Parameter(torch.tensor([1.0], dtype=torch.float))
        self.register_buffer('shift_value', torch.tensor([0], dtype=torch.float))
        self.register_buffer('multiplier_vector', torch.ones(4608, dtype=torch.float)) 
        self.register_buffer('zero_point', torch.tensor([0], dtype=torch.int))
        self.register_buffer('eps', torch.tensor([torch.finfo(torch.float32).eps]))
        self.use_grad_scaling = use_grad_scaling
        self.drop_prob = 1.0
        self.observer_for_outlier_channel = observer(bit=bit, symmetric=symmetric, ch_axis=0)
        self.update_shift_value = 0

    @torch.jit.export
    def enable_shift_value_updata(self):
        self.update_shift_value = 1 

    @torch.jit.export
    def disable_shift_value_updata(self):
        self.update_shift_value = 0

    def forward(self, X):
        torch.autograd.set_detect_anomaly(True)
        'get blcok id for outlier channel index'
        block_id=global_val()

        channel_index_sorted = sorted(outlier_channel_index[block_id])

        if self.observer_enabled == 1:
            'shift transpose'
            x_shift=X.transpose(0,2)
            x_shift_flat = torch.flatten(x_shift, start_dim=1)
            min_val_for_shift, max_val_for_shift = torch._aminmax(x_shift_flat, 1)
            shift_val=(min_val_for_shift+max_val_for_shift)/2
            self.shift_value.data = torch.ones_like(shift_val)
            self.shift_value.data.copy_(shift_val)

            x_shift=x_shift-self.shift_value.data.unsqueeze(1).unsqueeze(2) 

            'delate outlier channel for initial'

            'get blcok id for outlier channel index'
            block_id=global_val()

            indices_to_remove = torch.tensor(channel_index_sorted)

            mask = torch.ones(x_shift.size(0), dtype=torch.bool)
            mask[indices_to_remove] = False  


            channel_without_outlier_after_shift = x_shift[mask]

            self.observer(channel_without_outlier_after_shift.detach())
            _scale, _zero_point = self.observer.calculate_qparams(self.observer.min_val, self.observer.max_val)
            _scale, _zero_point = _scale.to(self.scale.device), _zero_point.to(self.zero_point.device)

            mask_outlier = torch.zeros(x_shift.size(0), dtype=torch.bool)
            mask_outlier[indices_to_remove] = True  

            channel_outlier_after_shift = x_shift[mask_outlier]
            self.observer_for_outlier_channel(channel_outlier_after_shift.detach())
            _scale_outlier_temp, _zero_point_outlier_temp = self.observer_for_outlier_channel.calculate_qparams(self.observer_for_outlier_channel.min_val, self.observer_for_outlier_channel.max_val)
            _scale_outlier_temp, _zero_point_outlier_temp = _scale_outlier_temp.to(self.scale.device), _zero_point_outlier_temp.to(self.zero_point.device)
            scale_all = torch.cat((_scale_outlier_temp, _scale.unsqueeze(0)), dim=0)
            scale_all=scale_all.to(self.scale.device)

            self.scale.data = torch.ones_like(scale_all)
            self.zero_point.resize_(_zero_point.shape)

            self.scale.data.copy_(scale_all)
            self.zero_point.copy_(_zero_point)
            'multiplier_vector'
            split_factor = torch.round(self.scale[:-1] / self.scale[-1])
            split_factor_new = torch.where(split_factor == 0, torch.tensor(1, device=split_factor.device), split_factor.clone())
            self.multiplier_vector = torch.ones(4608).to(self.scale.device)
            self.multiplier_vector[channel_index_sorted] = split_factor_new
        else:
            self.scale.data.abs_()
            self.scale.data.clamp_(min=self.eps.item())

        if self.update_shift_value == 1:
            print("debug update_shift_value",block_id)
            # Initialize momentum parameters for shift_value updates
            momentum = 0.95  #  Zero-quant Adjust this value as necessary
            shift_momentum = self.shift_value.data  # Initialize momentum buffer change @ 10.18

            cur_fp_inp_transpose=X.transpose(0,2)
            cur_fp_inp_transpose_flat = torch.flatten(cur_fp_inp_transpose, start_dim=1)
            min_val_batch, max_val_batch = torch._aminmax(cur_fp_inp_transpose_flat, 1)
            shift_val_batch=(min_val_batch+max_val_batch)/2

            # Update shift_value using momentum
            shift_momentum = momentum * shift_momentum + (1 - momentum) * shift_val_batch
            self.shift_value.data = shift_momentum
          
        if self.fake_quant_enabled == 1:


            'scale'
            scale_for_compute = self.scale[-1] 
                   
            'zero_point'
            'shift'
            x_shift_inference=X.transpose(0,2)
            x_shift_inference=x_shift_inference-self.shift_value.unsqueeze(1).unsqueeze(2)

            'multiplier_vector'
            split_factor_inf = torch.round(self.scale[:-1] / self.scale[-1])
            split_factor_new_inf = torch.where(split_factor_inf == 0, torch.tensor(1, device=split_factor_inf.device), split_factor_inf.clone())
            self.multiplier_vector = torch.ones(4608).to(self.scale.device)
            self.multiplier_vector[channel_index_sorted] = split_factor_new_inf 
            'transfer'                       
            x_shift_transfer = x_shift_inference / self.multiplier_vector.unsqueeze(1).unsqueeze(2)
            shift_value_transfer = self.shift_value / self.multiplier_vector  

            if self.drop_prob < 1.0:
                X_t= X.transpose(0,2)
                X_t = X_t / self.multiplier_vector.unsqueeze(1).unsqueeze(2)
                x_orig = X_t.transpose(0,2)  
                print("debug GELU self.drop_prob < 1",block_id) 

            if self.use_grad_scaling:
                grad_factor = 1.0 / (x_shift_transfer.numel() * self.quant_max) ** 0.5
            else:
                grad_factor = 1.0
            x_shift_transfer = fake_quantize_learnable_per_tensor_affine_training(
                x_shift_transfer, scale_for_compute, self.zero_point, self.quant_min, self.quant_max, grad_factor)
            'shift back'
            x_shift_transfer = x_shift_transfer + shift_value_transfer.unsqueeze(1).unsqueeze(2)
            X_transfer = x_shift_transfer.transpose(0,2)            
            if self.drop_prob < 1.0:
                x_prob = torch.where(torch.rand_like(X_transfer) < self.drop_prob, X_transfer, x_orig)
                return x_prob, self.multiplier_vector
        else:
            print("initial+fp",block_id)
            X_transfer= X.transpose(0,2)
            X_transfer = X_transfer / self.multiplier_vector.unsqueeze(1).unsqueeze(2)
            X_transfer= X_transfer.transpose(0,2)  

        return X_transfer, self.multiplier_vector




